import emergency from '../../images/emergency.png';
import circle from '../../images/circle.png';
import getmeout from '../../images/getmeout.png';
import journey from '../../images/journey.png';
import privacy from '../../images/privacy.png';
import security from '../../images/security.png';


const styles = {

    container: {
        width: '30vw',
        padding: '20px',
        background: '#FFFFFF',
    },

    textcontainer:{
        width: '25vw',
        padding: '20px',
    },

    h1: {
        fontSize: '20px',
        color: '#37207b',
    },

    p: {
        fontSize: '14px',
        color: '#404040',
    }
}

const FeaturescardCircle = (props) => { 
    const { t } = useTranslation();

return (
    <div style={styles.container}>
        <div style={styles.textcontainer}>
            <h1 style={styles.h1}>{t('features.circleHeader')}</h1>

            <p style={styles.p}>{t('features.circleText')}</p>
        </div>
    </div>
);

};

const FeaturescardJourney = (props) => { 
    const { t } = useTranslation();

return (
    <div style={styles.container}>
        <img src={circle} height={30} width={130} />
        <div style={styles.textcontainer}>
        <img src={circle} height={30} width={130} />

            <h1 style={styles.h1}>{t('features.circleHeader')}</h1>

            <p style={styles.p}>{t('features.circleText')}</p>
        </div>
    </div>
);

};



export {
    FeaturescardCircle,
    FeaturescardJourney
}
